homedescription:
***SOLD - September 2015***
Condo in a four-unit Edwardian building for sale by owner (FSBO). Unit is vacant and ready for move-in.


SALE PRICE of $650,000 - no agent commissions. WRITE your offer paperwork with a real estate lawyer with a FLAT FEE to keep the sale price down. Buyer and seller pay their own lawyer fees - you can find your own, hire mine, or find an agent who will write your sales offer. No negotiations BUT: YES - you'll need to order house inspections with a qualified professional, and determine if you want to make those minor repairs. 
SOLD AS IS
This six-room flat is sold "as-is." It is in great shape and lovely. Needs minor upgrades, but is turnkey ready.


 Please only make offers if you plan to live in the unit.


THE CULTURAL "PROMISSORY NOTE": In addition to the sale price, please make an offer of a 10-year "note" of something of cultural value. You will be obligated to fulfill that promissory note. Make offers creative! Reach out to your networks to help you buy an affordable flat in the Mission!


It can be something you personally have access to, like 10 years of tickets for the theatre, 10 years VIP tix for music festivals, or 10 years of organic produce from your uncle's farm in Salinas.


It can be something you would have to buy, or something you have access to via your family and friends. Culture and experience are valuable to sellers, and we'd rather barter some of the value of the flat if you have community/cultural capital as a resource. If you offer something you would purchase, like 10 years of tickets to the Great American Music Hall / Slim's, then the expense cap is $3,000 a year.

DESCRIPTION 
Come live in the core of the Mission District and become part of an amazing neighborhood! Encouraging all artists, writers, teachers, makers, librarians, and community builders who want to contribute to the bohemian charm and cultural diversity of The Mission District.


DETAILS
1. Mission District (Central);

2. Built in early 1900's, and converted to condos 40 years ago. Amazing period charm is intact and has not been gutted;

3.  6-room vintage Edwardian railroad flat (built 1902, remodeled 1978 and 2003);

4. "Fainting Room" - front parlor or library with decorative marble fireplace & built-in bookcases;

5. 1 large bedrooom with giant closets;

6. 1 medium sized bedroom (or office) with a big window onto a small deck, galley storage loft, & french doors;

7. Remodeled bathroom with imported tile, extra deep tub, large linen closet, Victorian period sink and fixtures (sink has a crack);

8. Medium sized kitchen with wood butcher block eating bar, tons of counter space & storage, double sink, a newish glass topped stove, a newish refrigerator, and an almost dead dishwasher;

9. Wood paneled great room overlooking the garden (joined to the kitchen over the butcher block bar);

10.  Laundry room in garage with washer and dryer;

11.  One car parking (parallel) (5'11" entry height); free street parking (no city permit sticker);

12. Garage storage space, and separate (common) gardening tools storage space;

13.  Mahogany wood paneling in three rooms;

14.  Original turn of the century hard-wood & soft-wood & wood parquet floors throughout;

15.  High ceilings with new picture molding everywhere;

16.  New double paned windows in (almost) every room (wood and vinyl, sliding and casement);

17.  Perfect for gardening, and staircase onto garden and the most sun on this unit's staircase;

DISCLAIMERS:

1. No dogs allowed per condo rules; 
2.  Washer and dryer are shared with two other units (1 person in each unit);
3. Garage: each space is allocated to a unit;
4. The Carnivale Festival is a neighborhood treasure. Agreement to not make complaints about Carnivale will be part of the disclosure packet;
5. Dia de las Muertas is also a cultural treasure - same deal applies as for Carnivale.

