Top floor corner unit (3rd & 4th floors); 
1,729 sq feet;
2 Master Bedrooms;
3 Full Bathrooms;
Living Room with Gas Rireplace with Adjacent Dining Room;
Separate Den;
Breakfast Nook;
Large Loft / Office;
High Ceilings in Living Room, Dining Room and Den;
Granite Counters in Kitchen;
Large Front Loading Washer and Dryer;
2 Single Car Garages with Upgraded Storage Units;
Sunny Balcony with BEAUTIFUL Western Wide Water View of the Lagoon and Hills from All Windows;
Upgraded Carpet with Premium Padding and Additional Sound-Proofing Between Bedrooms;
Upgraded Hardwood Flooring and Baseboards;
Ceiling Mounted Rack in Kitchen for Pots & Pans;
Reverse Osmosis;
Upgraded Computer Network (CAT5), Cable and Satellite in All Rooms;
Living Room (7.1), Den (5.1) and Upstairs Bedroom (5.1) all Pre-wired for Home Theater / Surround Sound;
Ceiling Accent Lights in Kitchen, Breakfast Nook and Den;
Kitchen Pre-wired for TV;
Solid-core Doors on Bedrooms;
Shelving in Closets, Laundry Room and Pantry;
Dark-out Blinds on All 20 Windows;
Hide-away Screen Door on Front Door;
